import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';

const navStyle = {
  backgroundColor: '#333333',
  borderBottom: '1px solid #CCCCCC',
  boxShadow: '0 1px 1px rgba(0, 0, 0, 0.1)',
  padding: '20px 0'
};

const linkStyle = {
  color: '#FFFFFF',
  fontWeight: 'bold',
  marginLeft: '90px',
  margin

};

function TopNav() {
  return (
    <Navbar style={navStyle} expand="lg">
      <Navbar.Brand href="#home" style={{ color: '#FFFFFF', fontWeight: 'bold' }}>
        Your Company Name
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav" />
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ml-auto">
          <Nav.Link href="#home" style={linkStyle}>
            Home
          </Nav.Link>
          <Nav.Link href="#about" style={linkStyle}>
            About
          </Nav.Link>
          <Nav.Link href="#services" style={linkStyle}>
            Services
          </Nav.Link>
          <Nav.Link href="#contact" style={linkStyle}>
            Contact
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}

export default TopNav;
